超・硬刃体＋ダブルチタニウムコーティングで更に肌あたり優しく深ぞり３枚刃。握りやすいラウンド形状のハンドルデザインと滑りにくいエラストマー樹脂で快適シェービング。<br><br>化粧品(\)男性化粧品(メンズコスメ)(\)男性化粧品(メンズコスメ) シェービング <br>ベスティーEX3 3本入<br>首振り式で3枚刃のカミソリです。ビタミンE配合のアロエスムーザーを搭載し、肌はさっぱりし、深剃りができます。また、ダブルチタニウムコーティングによって、よりヒゲへのシャープな切り込みと、肌へのやさしさをかねそなえた刃先形状を形成しました。 <br>ご注意：・ひげそりを目的にしたカミソリです。それ以外に使用しないでください。・お肌に合わない時はご使用を中止してください。・刃先を拭かないでください。肌を痛めるおそれがあります。・そる部分にシェービングフォーム、またはよく泡立てた石鹸などをつけて、使用してください。カミソリを持つ手がすべらないように注意してください。・使用後はよくすすぎ、水気をきってからキャップをして、乾燥した場所に保管してください。・70度以上の熱湯に入れないでください。変形することがあります。・未使用のカミソリは乾燥した所に保管してください。湿度の高い場所では、スムーザーが溶け出す場合があります。スムーザーは溶けて色が変わります。品質に変化はありません。・お子様の手の届かない所に保管してください。・刃物ですので、取り扱いや保管には十分ご注意ください。 品質表示・刃部ステンレス刃物鋼/長さ35mmチタニウムコーティングスムーザー：水溶性樹脂・樹脂部ABS、エラストマー：耐熱温度70度キャップ：PP <br>原産国：中国<br>、刃：日本 お問い合わせ先貝印カミソリ株式会社お客様相談室：03-3862-6410受付時間：9：00-12：00/13：00-17：00(土・日・祝日を除く)  <br>販売_製造元： 貝印<br>ブランド：べスティーEX<br>JAN：4901331014932<br>CS：200<br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<br><style type="text/css">
